import React, { Component } from 'react'


class ChessChart extends Component {
     
    render() {
        return (
          <React.Fragment>
            <p> Chess</p>
            <div> Total Viewers : {this.props.chessViewers} </div>
          </React.Fragment>
        )
    }
}
 
export default ChessChart
